import Datas from '../datas/data.json'

function Offers () {
    datas.map((offers, index) => {
    return (
        <div key={index}>
            <Datas />
            <h2>{offers.title}</h2>

        <img src={offers.cover} alt={offers.title}></img>
    </div>
    )})
}

export default Offers
